function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <i
      className={`fa fa-chevron-left ${className}`}
      style={{ ...style, display: "block", color: "black" }}
      onClick={onClick}
    />
  );
}

export default SamplePrevArrow
